import React from 'react';
import { Card, Timeline } from 'antd';
import moment from 'moment';

const MemberJourney = ({ journey }) => (
  <Card title="Member Journey">
    <Timeline>
      {journey.map((ep, idx) => (
        <Timeline.Item key={idx}>
          <Card size="small">
            <h4>{ep.episode}</h4>
            <p>{moment(ep.start_date).format('MMM DD')} â€“ {moment(ep.end_date).format('MMM DD, YYYY')}</p>
            <p>{ep.events.length} events during this episode</p>
          </Card>
        </Timeline.Item>
      ))}
    </Timeline>
  </Card>
);

export default MemberJourney;
